function diff( a, b) {
  var diff = a.filter((e)=>!~b.indexOf(e));
  return diff.concat(b.filter((e)=>!~a.indexOf(e)));
}


function filterDuplicates(array) {
  let tempSet = new Set(array)
  let filtered = Array.from(tempSet)

      console.log(diff(array, filtered))

  return filtered
}


export default filterDuplicates
